A 4-inch by 6-inch picture is enlarged for framing  by tripling its dimensions.  A 2-inch-wide border  is then placed around each side of the enlarged  picture, as shown.  Thin metal framing is sold only  in increments of one foot.  What is the minimum  number of linear feet of framing that must be  purchased to go around the perimeter of the border?

[asy]

draw((0,0)--(14,0)--(14,20)--(0,20)--cycle,linewidth(2));

draw((4,4)--(10,4)--(10,16)--(4,16)--cycle);

label("border",(7,17),N);

label("picture",(7,8),N);

label("frame",(14,5),E);

draw((17.5,7.5)--(14.5,7.5),Arrow);
draw((10.5,7.5)--(13.5,7.5),Arrow);

[/asy]

In rectangle $PQRS,$ $PQ=12$ and $PR=13.$ What is the area of rectangle $PQRS?$

[asy]
draw((0,0)--(12,0)--(12,5)--(0,5)--cycle,black+linewidth(1));
draw((0,5)--(12,0),black+linewidth(1));
label("$P$",(0,5),NW);
label("$Q$",(12,5),NE);
label("$R$",(12,0),SE);
label("$S$",(0,0),SW);
label("12",(0,5)--(12,5),N);
label("13",(0,5)--(12,0),SW);
[/asy]

answer:
The sum of the angle measures of a hexagon is $180(6-2) = 720$ degrees, so each angle of a regular hexagon measures $720^\circ/6=120^\circ$.  Therefore, $\angle BAF = 120^\circ$, which means $\angle FAP = 180^\circ - \angle BAF = 60^\circ$.  Similarly, $\angle PFA = 60^\circ$.  Since the angles of $\triangle APF$ sum to $180^\circ$, we have $\angle APF = 180^\circ - 60^\circ - 60^\circ = \boxed{60^\circ}$.

[asy]
unitsize(0.6inch);
pair A,B,C,D,EE,F,P;

A = (1,0);
B = rotate(60)*A;
C=rotate(60)*B;
D = rotate(60)*C;
EE = rotate(60)*D;
F = rotate(60)*EE;

P = A + (A - B);
draw (A--B--C--D--EE--F--A--P--F,linewidth(1));
label("$A$",A,NE);
label("$B$",B,N);
label("$C$",C,N);
label("$D$",D,W);
label("$E$",EE,S);
label("$F$",F,S);
label("$P$",P,S);
[/asy]
